import React,{useState} from 'react'

function Calculator() {
  const[input, setInput] = useState('')
  const handleChange = (e) =>{
      setInput(e.target.value)
  }
  return (
    <div>
        <input type='text' value={input} name ='input' onChange={handleChange}></input>
    </div>
  )
}

export default Calculator
